import React from "react";
import { useSelector } from "react-redux";
import Navbar from "../components/header/Navbar";
import { Link } from "react-router-dom";

const Account = () => {
  const user = useSelector((state) => state.user);

  return (
    <>
      <Navbar />
      <div className="profile-container">
        {user.isLoggedIn ? (
          <div className="only-profile">
            <img
              src="https://img.freepik.com/free-photo/top-view-arrangement-with-salad-boxes-sauce_23-2148247882.jpg?w=740&t=st=1692709585~exp=1692710185~hmac=bacddd6a681f238f85bf29020feccb0e1dd4d81f51945836080753ed134a1b94"
              alt="profile"
            />
            <div>
              <img
                src="https://www.nicepng.com/png/detail/933-9332131_profile-picture-default-png.png"
                alt="profile"
                className="profile"
              />
            </div>
            <div>
              <h1 className="user">{user.name}</h1>
              <div class="top-left">
                <h1>{user.orderCount}</h1>
                <h1>Order</h1>
              </div>
              <div class="top-right">
                <h1>{user.totalPrice}</h1>
                <h1>Price</h1>
              </div>
            </div>
          </div>
        ) : (
          <div className="login-register-links">
            <Link to="/login">Login</Link> | 
            <Link to="/register">Register</Link>
          </div>
        )}
        {user.isLoggedIn && (
          <div className="wish-container">
            <h1 className="h1-text">Your Wishlist</h1>
            <div className="main">
              {user.wishlist.length === 0 ? (
                <div>
                  <h1 className="text">No Item in wishlist!</h1>
                </div>
              ) : (
                user.wishlist?.map((item) => (
                  <div className="under-container" key={item.id}>
                    <div className="explore-card-cover">
                      <Link to={`/item/${item.id}`}>
                        <img
                          src={item.image}
                          alt={item.name}
                          className="explore-card-image"
                        />
                      </Link>
                    </div>
                    <div className="food-name">{item.name}</div>
                    <div className="rat-pir">
                      <div className="approx-price">{item.price + "$"}</div>
                    </div>
                  </div>
                ))
              )}
            </div>
          </div>
        )}
      </div>
    </>
  );
};

export default Account;
